import React from "react";
import { FcCheckmark } from "react-icons/fc";

const Package = () => {
  return (
    <div className="border" style={{ height: 250, width: 250, margin: 20 }}>
      <div style={{ backgroundColor: "red", color: "white", opacity: 0.5 }}>
        <h4>STANDARD</h4>
        <h5>1700/Sqft</h5>
      </div>

      <div
        className="row"
        style={{ textAlign: "left", fontSize: 14, padding: 5 }}
      >
        <FcCheckmark className="col-2" style={{ marginTop: 4 }} />
        <p className="col-10" style={{ margin: 0, padding: 0 }}>
          Structure – branded and high quality cement, steel, concrete, bricks
        </p>
        <FcCheckmark className="col-2" style={{ marginTop: 4 }} />
        <p className="col-10" style={{ margin: 0, padding: 0 }}>
          Bare shell – W/O Interiors
        </p>
      </div>
      <button>VIEW MORE</button>
    </div>
  );
};

const styles = {
  checkMark: {
    margin: 5,
  },
};
export default Package;
